import React from 'react';
import "./Navbar.css";

function Navbar() {
  return (
    <div>
        <ul>
            <li>home</li>
            <li>about</li>
            <li>speakers</li>
            <li>schedule</li>
            <li>pricing</li>
            <li>Blog</li>
            <li>Contact</li>
            <input type={'button'} value='Buy ticket'/>
        </ul>
    </div>
  )
}

export default Navbar
